Insert into GAMETRACKER.GROUVEE_IMPORT (ID,NAME,SHELVES,PLATFORMS,RATING,REVIEW,DATES,STATUSES,GENRES,FRANCHISES,DEVELOPERS,PUBLISHERS,RELEASE_DATE,URL,GIANTBOMB_ID) values ('123','Assassin''s Creed: Brotherhood','{"Steam": {"url": "http://www.grouvee.com/user/Guran/shelves/35271-steam/", "date_added": "2015-04-13T09:30:25Z"}, "Played": {"url": "http://www.grouvee.com/user/Guran/shelves/35267-played/", "date_added": "2015-04-13T09:30:25Z"}}','{"PC": {"url": "http://www.grouvee.com/games/?platform=pc"}, "Mac": {"url": "http://www.grouvee.com/games/?platform=mac"}}','5','<p>The third title in this fantastic series still oozes quality. One of the main attractions in an Assassin''s Creed game is to explore the cities and Rome is full of interesting locations. Hideouts are still very fun to beat and explore! The single player campaign is solid, even if its slighty less engaging this time around. What I find really impressive is that so much of the historical facts are accurate and seamlessly woven into the story. Graphics are even better now, with a weather system in place that feels very effective. Fighting is also improved, its good fun to rack up execution streaks even if it almost gets too easy. Other new additions include tower capturing and recruitment of assassins. But the best new addition is the cool multiplayer! I really like that being stealthy is just as important as racking up kills.</p>','[{"date_finished": "None", "date_started": "None", "level_of_completion": null, "seconds_played": 201960}]','[]','{"Action-Adventure": {"url": "http://www.grouvee.com/games/?genre=action-adventure"}}','{"Assassin''s Creed": {"url": "http://www.grouvee.com/games/franchise/769-assassins-creed/"}}','{"Ubisoft Montreal Studios": {"url": "http://www.grouvee.com/games/?developer=ubisoft-montreal-studios"}}','{"Ubisoft Entertainment": {"url": "http://www.grouvee.com/games/?publisher=ubisoft-entertainment"}}','2010-11-16','http://www.grouvee.com/games/123-assassins-creed-brotherhood/','31001');
