Insert into GAMETRACKER.GROUVEE_IMPORT (ID,NAME,SHELVES,PLATFORMS,RATING,REVIEW,DATES,STATUSES,GENRES,FRANCHISES,DEVELOPERS,PUBLISHERS,RELEASE_DATE,URL,GIANTBOMB_ID) values ('30594','Back to the Future: The Game - Episode 5: OUTATIME','{"Played": {"url": "http://www.grouvee.com/user/Guran/shelves/35267-played/", "date_added": "2015-04-13T22:23:08Z"}}','{"PC": {"url": "http://www.grouvee.com/games/?platform=pc"}}','5','<p>A fitting end to the series. After the fourth episodes everything was so confused that I thought they were gonna mess the ending up. Im happy to say they didnt, all loose ends were tied up. The disappointing fourth episode was just a setback, here the puzzles make sense and I was always motivated to push ahead. The voice acting is fantastic throughout the series but now the cast was completed with Michael J Fox himself! It was a fantastic surprise and it also showed what an incredibly good job A.J. Locascio does as the voice of Marty. He sounds exactly like a younger version of Michael! There were a couple of bugs and even one that affected gameplay, which was mildly annoying. However, since this episode had more exciting moments than any previous episode, Im generous and give OUTATIME the full 5 stars.</p><p>My grade for the whole series is 4 stars. Recommended for fans of the franchise!</p>','[]','[]','{"Adventure": {"url": "http://www.grouvee.com/games/?genre=adventure"}}','{"Back to the Future": {"url": "http://www.grouvee.com/games/franchise/1249-back-to-the-future/"}}','{"Telltale Games": {"url": "http://www.grouvee.com/games/?developer=telltale-games"}}','{"Telltale Games": {"url": "http://www.grouvee.com/games/?publisher=telltale-games"}}','2011-06-23','http://www.grouvee.com/games/30594-back-to-the-future-the-game-episode-5-outatime/','33417');
