Insert into GAMETRACKER.GROUVEE_IMPORT (ID,NAME,SHELVES,PLATFORMS,RATING,REVIEW,DATES,STATUSES,GENRES,FRANCHISES,DEVELOPERS,PUBLISHERS,RELEASE_DATE,URL,GIANTBOMB_ID) values ('30359','Superbrothers: Sword & Sworcery EP','{"Steam": {"url": "http://www.grouvee.com/user/Guran/shelves/35271-steam/", "date_added": "2015-04-13T09:30:35Z"}, "Played": {"url": "http://www.grouvee.com/user/Guran/shelves/35267-played/", "date_added": "2015-04-13T09:30:35Z"}}','{"PC": {"url": "http://www.grouvee.com/games/?platform=pc"}, "Mac": {"url": "http://www.grouvee.com/games/?platform=mac"}, "Linux": {"url": "http://www.grouvee.com/games/?platform=linux"}}','3','<p>This game has been very hyped and I do think it is overrated. Art direction is nice and music is fabulous. I also like their casual approach, in that they enourage you to take breaks. But the adventure elements themselves are not great. Some things do not work at all. The moon phases are horrible, I want to play when I want and not wait for the moon. The cave trick may work but is easy to fail and you end up with much backtracking. And changing the system clock is just so immersion breaking. Its best to play this on IPhone/IPad as the gestures are more effective on a touchscreen.</p>','[{"date_finished": "None", "date_started": "None", "level_of_completion": null, "seconds_played": 5400}]','[]','{"Adventure": {"url": "http://www.grouvee.com/games/?genre=adventure"}}','{}','{"Capybara Games": {"url": "http://www.grouvee.com/games/?developer=capybara-games"}, "8-4, Ltd.": {"url": "http://www.grouvee.com/games/?developer=8-4-ltd"}}','{"Capybara Games": {"url": "http://www.grouvee.com/games/?publisher=capybara-games"}}','2011-03-24','http://www.grouvee.com/games/30359-superbrothers-sword-sworcery-ep/','33139');
