Insert into GAMETRACKER.GROUVEE_IMPORT (ID,NAME,SHELVES,PLATFORMS,RATING,REVIEW,DATES,STATUSES,GENRES,FRANCHISES,DEVELOPERS,PUBLISHERS,RELEASE_DATE,URL,GIANTBOMB_ID) values ('2438','Indigo Prophecy','{"Steam": {"url": "http://www.grouvee.com/user/Guran/shelves/35271-steam/", "date_added": "2015-04-13T09:30:29Z"}, "Played": {"url": "http://www.grouvee.com/user/Guran/shelves/35267-played/", "date_added": "2015-04-13T09:30:29Z"}}','{"PC": {"url": "http://www.grouvee.com/games/?platform=pc"}}','5','<p>This is a fantastic interactive movie from the director of Heavy Rain. Only downside is that the plot is rushed towards the end but that shouldnt stop you from experiencing it. There are a couple of scares but where the game really shines is in its ability to mix true emotion with cool action sequences. Graphics are ok but they are dated by todays standards. But the soundtrack by Angelo Badalementi never ages. The music fits perfectly and is definitely on par with his previous work in Twin Peaks and Mulholland Drive. Most of the gameplay focuses on "Simon Says" sequences where you have to push buttons in the correct order. Sounds boring but I really liked it, they made me feel like I was part of the action.<br/><br/>Any fans of adventure games or good suspense movies should give Indigo Prophecy a try.</p>','[{"date_finished": "None", "date_started": "None", "level_of_completion": null, "seconds_played": 37440}]','[]','{"Adventure": {"url": "http://www.grouvee.com/games/?genre=adventure"}}','{}','{"Quantic Dream": {"url": "http://www.grouvee.com/games/?developer=quantic-dream"}, "Aspyr Media, Inc.": {"url": "http://www.grouvee.com/games/?developer=aspyr-media-inc"}}','{"Atari SA": {"url": "http://www.grouvee.com/games/?publisher=atari-sa"}, "Aspyr Media, Inc.": {"url": "http://www.grouvee.com/games/?publisher=aspyr-media-inc"}}','2005-09-16','http://www.grouvee.com/games/2438-indigo-prophecy/','2494');
