Insert into GAMETRACKER.GROUVEE_IMPORT (ID,NAME,SHELVES,PLATFORMS,RATING,REVIEW,DATES,STATUSES,GENRES,FRANCHISES,DEVELOPERS,PUBLISHERS,RELEASE_DATE,URL,GIANTBOMB_ID) values ('9782','Monkey Island 2:  LeChuck''s Revenge','{"Steam": {"url": "http://www.grouvee.com/user/Guran/shelves/35271-steam/", "date_added": "2015-04-13T09:30:31Z"}, "Played": {"url": "http://www.grouvee.com/user/Guran/shelves/35267-played/", "date_added": "2015-04-13T09:30:31Z"}}','{"PC": {"url": "http://www.grouvee.com/games/?platform=pc"}}','4','<p>*This review covers the special edition released in digital stores*</p><p>First the good news - LucasArts did a much better job with this Special Edition than the one for The Secret of Monkey Island. The new graphics are beautiful and the interface has improved so much that I dont want to switch to classic mode much at all. They also included bonus stuff like concept art and funny commentaries from the authors of the original game (Ron Gilbert, Dave Grossman, Time Schafer) which is a really nice touch. The bad news - I realised that the witty dialog just isnt matched in the game design. Many puzzles just doesnt make sense and often feel contrived and not part of the main storyline. Why would Guybrush want to win a spitting contest in order to find Big Whoop for example? There are also "puzzles" for people who like to randomly try all inventory objects on everything until something succeeds ("monkey wrench" anyone?). In the original version pointless puzzles like these could be omitted in a "casual" mode. I must be the only one who liked the<br/> casual mode better, since its not included in this special edition. I had previously rated this game a 5 for nostalgic reasons but the design issues above made me lower it to a 4. Still a classic though, well worth a playthrough.<br/></p>','[{"date_finished": "None", "date_started": "None", "level_of_completion": null, "seconds_played": 32040}]','[]','{"Adventure": {"url": "http://www.grouvee.com/games/?genre=adventure"}}','{"Monkey Island": {"url": "http://www.grouvee.com/games/franchise/779-monkey-island/"}}','{"LucasArts Entertainment Company LLC": {"url": "http://www.grouvee.com/games/?developer=lucasarts-entertainment-company-llc"}}','{"U.S. Gold Ltd.": {"url": "http://www.grouvee.com/games/?publisher=us-gold-ltd"}, "LucasArts Entertainment Company LLC": {"url": "http://www.grouvee.com/games/?publisher=lucasarts-entertainment-company-llc"}}','1991-12-01','http://www.grouvee.com/games/9782-monkey-island-2-lechucks-revenge/','10528');
Insert into GAMETRACKER.GROUVEE_IMPORT (ID,NAME,SHELVES,PLATFORMS,RATING,REVIEW,DATES,STATUSES,GENRES,FRANCHISES,DEVELOPERS,PUBLISHERS,RELEASE_DATE,URL,GIANTBOMB_ID) values ('30592','Back to the Future: The Game - Episode 3: Citizen Brown','{"Played": {"url": "http://www.grouvee.com/user/Guran/shelves/35267-played/", "date_added": "2015-04-13T22:23:04Z"}}','{"PC": {"url": "http://www.grouvee.com/games/?platform=pc"}}','4','<p>This time Marty is in serious trouble, as usual! He has crashed the time machine and is now stuck in an alternate timeline! Too much time travelling makes my head spin so I like that he stays in the same place and time this whole episode. Just the setting of Doc and Edna overseeing a 1984-like (ok, it takes place in 1986) Hill Valley makes this episode original and fun. The episode takes about 2-3 hours to finish just like the previous episodes in the series. Many people seem to want a longer game but I for one think that this is a perfect length for a game episode. Puzzles are easy but that doesn''t matter since the story never gets boring and keeps you captivated all the way to the cliffhanger.<br/><br/>Voice acting is fantastic, with AJ Locascio doing commendable work as Marty. Telltale should be lucky that they found this up and coming voice talent! Christopher Lloyd has not as much to do in this episode unfortunately, personally I hope we get to see more of "old" Doc. His partnership with Marty is a classic one and feels just like in the movies (well, THIS particular episode might be an exception).<br/><br/>Bottom line is, you''ll be happy as long as you don''t expect a challenging game. This is more like a fun ride and a set of very good interactive movies. All who liked the original movies should get this game series, as the episodes just gets better and better.</p>','[]','[]','{"Adventure": {"url": "http://www.grouvee.com/games/?genre=adventure"}}','{"Back to the Future": {"url": "http://www.grouvee.com/games/franchise/1249-back-to-the-future/"}}','{"Telltale Games": {"url": "http://www.grouvee.com/games/?developer=telltale-games"}}','{"Telltale Games": {"url": "http://www.grouvee.com/games/?publisher=telltale-games"}}','2011-03-28','http://www.grouvee.com/games/30592-back-to-the-future-the-game-episode-3-citizen-brown/','33415');
