Insert into GAMETRACKER.GROUVEE_IMPORT (ID,NAME,SHELVES,PLATFORMS,RATING,REVIEW,DATES,STATUSES,GENRES,FRANCHISES,DEVELOPERS,PUBLISHERS,RELEASE_DATE,URL,GIANTBOMB_ID) values ('47011','Thimbleweed Park','{"Steam": {"url": "http://www.grouvee.com/user/Guran/shelves/35271-steam/", "date_added": "2017-03-31T02:15:07Z"}, "Played": {"url": "http://www.grouvee.com/user/Guran/shelves/35267-played/", "date_added": "2017-04-04T23:07:35Z"}}','{"PC": {"url": "http://www.grouvee.com/games/?platform=pc"}, "Mac": {"url": "http://www.grouvee.com/games/?platform=mac"}, "Linux": {"url": "http://www.grouvee.com/games/?platform=linux"}}','5','This is a point and click adventure that feels just like a classic LucasArts game. That is no surprise, since the project is headed by Ron Gilbert, the Monkey Island and Maniac Mansion creator. What surprised me the most is that even though I didn''t find the game very funny, it didn''t hurt my experience at all. It''s instead quite charming and has more than a few heart warming moments. The puzzles are just the right level of difficulty on Hard for seasoned adventure gamers. And for newcomers there is a Casual mode that makes things less frustrating. Another thing that surprised me is that this is not a small adventure game, it''s really long but I never got bored! I replayed Monkey Island 1 & 2 recently and none of them are longer than ten hours. Here I finished in at about 25 hours (exploring mostly everything) and even with a walkthrough I don''t think I would have finished it in under 15 hours. There is lots of dialogue too good to skip through and there are many beautiful locations to explore. Something that did annoy me in the beginning was the constant fourth wall breaking. Characters make many comments about being in a game, that you don''t have to save often like in Sierra adventures and so on. The longer I played, the more I liked these things though. Overall I really recommend this game. The old adventure game magic is here in spades.','[{"date_finished": "None", "date_started": "None", "level_of_completion": "Main Story + Extras", "seconds_played": 90000}]','[]','{"Adventure": {"url": "http://www.grouvee.com/games/?genre=adventure"}}','{}','{"Terrible Toybox": {"url": "http://www.grouvee.com/games/?developer=terrible-toybox"}}','{"Terrible Toybox": {"url": "http://www.grouvee.com/games/?publisher=terrible-toybox"}}','2017-03-30','http://www.grouvee.com/games/47011-thimbleweed-park/','50511');
