Insert into GAMETRACKER.GROUVEE_IMPORT (ID,NAME,SHELVES,PLATFORMS,RATING,REVIEW,DATES,STATUSES,GENRES,FRANCHISES,DEVELOPERS,PUBLISHERS,RELEASE_DATE,URL,GIANTBOMB_ID) values ('11564','Heroes of Might and Magic II: The Succession Wars','{"Played": {"url": "http://www.grouvee.com/user/Guran/shelves/35267-played/", "date_added": "2015-04-13T21:03:30Z"}}','{"PC": {"url": "http://www.grouvee.com/games/?platform=pc"}}','5','<p>This was a game that literally hooked me in front of the computer for days back in the 90''s, when I was a student! Heroes 3 is still the superior version, but this second installation has a charm on its own. This game is similar to Warlords with a touch of RPG to it. Build armies, lead your heroes and conquer your foes! Its childens cartoon like graphics were nothing impressive even back then but its still playable. The music is very charming and one of my all time favorites! The other day I played the demo of Heroes 6 I was surpised at how little the game series has evolved since Heroes 2. If you''re just into Heroes for the single player you can just as well pick up number 2 or 3 instead of 6. They''re all good (well, I''ve not played 1 &amp; 4 so cant comment on these), but 2 &amp; 3 are my favorites!</p>','[]','[]','{"Role-Playing": {"url": "http://www.grouvee.com/games/?genre=role-playing"}, "Strategy": {"url": "http://www.grouvee.com/games/?genre=strategy"}}','{"Heroes of Might and Magic": {"url": "http://www.grouvee.com/games/franchise/288-heroes-of-might-and-magic/"}}','{"New World Computing, Inc.": {"url": "http://www.grouvee.com/games/?developer=new-world-computing-inc"}}','{"New World Computing, Inc.": {"url": "http://www.grouvee.com/games/?publisher=new-world-computing-inc"}}','1996-10-01','http://www.grouvee.com/games/11564-heroes-of-might-and-magic-ii-the-succession-wars/','12466');
