Insert into GAMETRACKER.GROUVEE_IMPORT (ID,NAME,SHELVES,PLATFORMS,RATING,REVIEW,DATES,STATUSES,GENRES,FRANCHISES,DEVELOPERS,PUBLISHERS,RELEASE_DATE,URL,GIANTBOMB_ID) values ('18501','Cave Story','{"Steam": {"url": "http://www.grouvee.com/user/Guran/shelves/35271-steam/", "date_added": "2015-04-13T09:30:27Z"}, "Played": {"url": "http://www.grouvee.com/user/Guran/shelves/35267-played/", "date_added": "2015-04-14T14:52:05Z"}}','{"PC": {"url": "http://www.grouvee.com/games/?platform=pc"}, "Mac": {"url": "http://www.grouvee.com/games/?platform=mac"}, "Linux": {"url": "http://www.grouvee.com/games/?platform=linux"}}','3','<p>When I was a kid, neither me nor my friends owned a Nintendo. We had to try Super Mario Bros in the toy store. Thus I''ve never had much of a connection with old Nintendo games like Zelda or Castlevania. Cave Story+ is a game made to look and feel just like them. It''s charming but not really up my alley. Its a nice game to play by its own merits though, once you customize the weird controls. Or just plug in a joypad. I have only gotten into a portion of the story as I write this but so far its nice with cute little rabbits ala Alice in Wonderland. Old Nintendo DS fans who want some nostalgia coupled with a fresh experience should give this a try!</p>','[{"date_finished": "None", "date_started": "None", "level_of_completion": null, "seconds_played": 6480}]','[]','{"Action-Adventure": {"url": "http://www.grouvee.com/games/?genre=action-adventure"}}','{}','{"Nicalis, Inc.": {"url": "http://www.grouvee.com/games/?developer=nicalis-inc"}, "Studio Pixel": {"url": "http://www.grouvee.com/games/?developer=studio-pixel"}}','{"Nicalis, Inc.": {"url": "http://www.grouvee.com/games/?publisher=nicalis-inc"}, "Studio Pixel": {"url": "http://www.grouvee.com/games/?publisher=studio-pixel"}}','2004-12-20','http://www.grouvee.com/games/18501-cave-story/','20124');
