Insert into GAMETRACKER.GROUVEE_IMPORT (ID,NAME,SHELVES,PLATFORMS,RATING,REVIEW,DATES,STATUSES,GENRES,FRANCHISES,DEVELOPERS,PUBLISHERS,RELEASE_DATE,URL,GIANTBOMB_ID) values ('3468','The Last Express','{"Played": {"url": "http://www.grouvee.com/user/Guran/shelves/35267-played/", "date_added": "2015-04-13T20:36:31Z"}}','{"PC": {"url": "http://www.grouvee.com/games/?platform=pc"}}','5','<p>This is a work of art. There are games out there with better gameplay but the atmosphere that they create in The Last Express is not like any other. Everything in the game feels authentic, from the recreated Orient Express to the performance of the characters. The characters are diverse and like in a good Agatha Christie novel, it feels like all of them got something to hide. A lot of small details add to the experience. For example you can pick up a paper and read about authentical historical events from 1914, when the game is set. Add an immersive story to the mix and you have a truly enjoyable game.<br/><br/>For a long time The Last Express has been very hard to get hold of, but now its available to download from <a href="http://gog.com/" rel="nofollow">gog.com</a> for a cheap price. Any adventure gaming fan should play this!</p>','[{"date_finished": "None", "date_started": "None", "level_of_completion": null, "seconds_played": 75600}]','[]','{"Adventure": {"url": "http://www.grouvee.com/games/?genre=adventure"}}','{}','{"DotEmu": {"url": "http://www.grouvee.com/games/?developer=dotemu"}, "Smoking Car Productions, Inc.": {"url": "http://www.grouvee.com/games/?developer=smoking-car-productions-inc"}}','{"DotEmu": {"url": "http://www.grouvee.com/games/?publisher=dotemu"}, "EuroVideo Medien GmbH": {"url": "http://www.grouvee.com/games/?publisher=eurovideo-medien-gmbh"}, "Br\u00f8derbund Software, Inc.": {"url": "http://www.grouvee.com/games/?publisher=brderbund-software-inc"}}','1997-04-01','http://www.grouvee.com/games/3468-the-last-express/','3626');
