Insert into GAMETRACKER.GROUVEE_IMPORT (ID,NAME,SHELVES,PLATFORMS,RATING,REVIEW,DATES,STATUSES,GENRES,FRANCHISES,DEVELOPERS,PUBLISHERS,RELEASE_DATE,URL,GIANTBOMB_ID) values ('29986','Faerie Solitaire','{"Steam": {"url": "http://www.grouvee.com/user/Guran/shelves/35271-steam/", "date_added": "2015-04-13T09:30:28Z"}, "Played": {"url": "http://www.grouvee.com/user/Guran/shelves/35267-played/", "date_added": "2015-04-13T09:30:28Z"}}','{"PC": {"url": "http://www.grouvee.com/games/?platform=pc"}, "Mac": {"url": "http://www.grouvee.com/games/?platform=mac"}}','4','<p>This game is relaxing to play for a while when you just need 30 minutes of brain dead clicking (like in my case when the kids wake you up at 5 in the morning and you need to do something to stay awake). Music tunes in the background are soothing and its nice that they wrapped a story, pets and collectibles around the card games as well to keep you going. Oh, and trying to get combos is addictive! Solitaire never gets better than this.</p>','[{"date_finished": "None", "date_started": "None", "level_of_completion": null, "seconds_played": 12240}]','[]','{"Card Game": {"url": "http://www.grouvee.com/games/?genre=card-game"}}','{}','{"Subsoap": {"url": "http://www.grouvee.com/games/?developer=subsoap"}}','{"Subsoap": {"url": "http://www.grouvee.com/games/?publisher=subsoap"}}','2010-09-18','http://www.grouvee.com/games/29986-faerie-solitaire/','32726');
Insert into GAMETRACKER.GROUVEE_IMPORT (ID,NAME,SHELVES,PLATFORMS,RATING,REVIEW,DATES,STATUSES,GENRES,FRANCHISES,DEVELOPERS,PUBLISHERS,RELEASE_DATE,URL,GIANTBOMB_ID) values ('120','Assassin''s Creed: Revelations','{"Played": {"url": "http://www.grouvee.com/user/Guran/shelves/35267-played/", "date_added": "2015-04-13T22:04:44Z"}}','{"PC": {"url": "http://www.grouvee.com/games/?platform=pc"}}','4','<p>Assassin''s Creed Revelations is a good game, even though the single player game story feels weaker this time around. There is no real antagonist, and it doesnt feel like Ezio finds out anything of great importance. But for those who have played the first Assassins Creed its nice to find out more about Altair. Gameplay is still very good and I experienced no bugs or glitches. I only had to do den defense once and had no issues with it at all, they must have patched it since launch. Desmonds sequences are ok. It feels like a separate game altogether though and the Subject 16 puzzles from the previous games were a better fit for Assassin''s Creed in my opinion. The already excellent multiplayer game has been improved with story elements and some nice new modes. Overall I really enjoyed the MP, even more so than single player. The death matches were very enjoyable. Its almost the same as Wanted but the maps are smaller and there is only an indicator that shows when the target is in sight.<br/>Overall this game is a nice iteration but nothing mandatory unless you''re already a fan of Assassin''s Creed (which I am).</p>','[{"date_finished": "None", "date_started": "None", "level_of_completion": null, "seconds_played": 252000}]','[]','{"Action-Adventure": {"url": "http://www.grouvee.com/games/?genre=action-adventure"}}','{"Assassin''s Creed": {"url": "http://www.grouvee.com/games/franchise/769-assassins-creed/"}}','{"Ubisoft Montreal Studios": {"url": "http://www.grouvee.com/games/?developer=ubisoft-montreal-studios"}}','{"Ubisoft Entertainment": {"url": "http://www.grouvee.com/games/?publisher=ubisoft-entertainment"}}','2011-11-15','http://www.grouvee.com/games/120-assassins-creed-revelations/','34975');
