Insert into GAMETRACKER.GROUVEE_IMPORT (ID,NAME,SHELVES,PLATFORMS,RATING,REVIEW,DATES,STATUSES,GENRES,FRANCHISES,DEVELOPERS,PUBLISHERS,RELEASE_DATE,URL,GIANTBOMB_ID) values ('42408','Elegy for a Dead World','{"Steam": {"url": "http://www.grouvee.com/user/Guran/shelves/35271-steam/", "date_added": "2016-10-01T02:12:16Z"}, "Played": {"url": "http://www.grouvee.com/user/Guran/shelves/35267-played/", "date_added": "2017-03-12T22:01:19Z"}}','{"PC": {"url": "http://www.grouvee.com/games/?platform=pc"}, "Mac": {"url": "http://www.grouvee.com/games/?platform=mac"}, "Linux": {"url": "http://www.grouvee.com/games/?platform=linux"}}','4','This is more of an fun educational tool than a game since it''s all about trying to get you, the player, to write! You can explore three beautiful worlds inspired by Byron, Keats and Shelley and then you try to write about these worlds! There are several different writing templates available or you can just write without one of course. Personally I liked to start with a template but change the text in it as I went, eventually ending up with something that was mainly my own story. The negative thing I can say is that the integration with the Steam Workshop could have been better. It would have been nice if I could''ve read other user''s stories more easily directly in the workshop without having to be in the game. But as a whole I''d recommend Elegy For a Dead World to anyone who wants a little nudge to get their creative minds flowing!','[{"date_finished": "None", "date_started": "None", "level_of_completion": null, "seconds_played": 14400}]','[]','{"Adventure": {"url": "http://www.grouvee.com/games/?genre=adventure"}, "Simulation": {"url": "http://www.grouvee.com/games/?genre=simulation"}}','{}','{"Dejobaan Games, LLC": {"url": "http://www.grouvee.com/games/?developer=dejobaan-games-llc"}, "Popcannibal": {"url": "http://www.grouvee.com/games/?developer=popcannibal"}}','{"Dejobaan Games, LLC": {"url": "http://www.grouvee.com/games/?publisher=