Insert into GAMETRACKER.GROUVEE_IMPORT (ID,NAME,SHELVES,PLATFORMS,RATING,REVIEW,DATES,STATUSES,GENRES,FRANCHISES,DEVELOPERS,PUBLISHERS,RELEASE_DATE,URL,GIANTBOMB_ID) values ('19545','Heavy Rain','{"Played": {"url": "http://www.grouvee.com/user/Guran/shelves/35267-played/", "date_added": "2015-04-13T09:16:05Z"}}','{"PlayStation 3": {"url": "http://www.grouvee.com/games/?platform=playstation-3"}}','5','<p>Since I played Indigo Prophecy (Fahrenheit) and loved it, it''s really no surprise that I was totally blown away by this title as well. After all, its from the same brilliant writer/director David Cage. Unfortunately, Indigo Prophecy suffered from a rushed and incomplete second part. With Heavy Rain, on the other hand, it''s the second part of the plot that really shines. I thought I had it all figured out and definitely didnt see the twist that was coming! The story and setting is inspired by the landmark movie "Se7en": its raining all the time, a serial killer is on the loose and there are a lot of tough moral decisions for the characters involved. But its different enough to make it feel unique and not like a ripoff.<br/><br/>The graphics are really good and there must have been alot of work to create so many detailed locations. The characters faces are very detailed and it adds to the authencity. Music is good, but I was so immersed in the game that I didnt notice it much. Gameplay is mostly about choosing dialogue options and pressing the correct buttons when they show up. While it may sound simple, for me it was quite hard since I''m new to the PS3 controller. I took the medium difficulty and got to a "happy" ending, although one of the playable characters died. And here is one feature that I think is unique to Heay Rain: even though your character can die, there are no "Game Over" screens! The story continues without him/her and the ending of the game changes. I had read about all that before I played and didnt think much of it. But when my character died, a sense of failure washed over me. Before I started Heavy Rain I had decided to never reload and at that time it was very hard not to do so.<br/> When the other characters got into trouble later on I was more determined to save them, since I wouldn''t get a second chance. It was truly immersive and I can recommend to play the game this way.<br/><br/>All in all, Heavy Rain is an incredible interactive drama! I have only finished it once but will definitely replay it and make different choices next time around.</p>','[]','[]','{"Action-Adventure": {"url": "http://www.grouvee.com/games/?genre=action-adventure"}, "Adventure": {"url": "http://www.grouvee.com/games/?genre=adventure"}}','{}','{"Quantic Dream": {"url": "http://www.grouvee.com/games/?developer=quantic-dream"}, "SCE XDev Studio": {"url": "http://www.grouvee.com/games/?developer=sce-xdev-studio"}}','{"Sony Computer Entertainment Europe": {"url": "http://www.grouvee.com/games/?publisher=sony-computer-entertainment-europe"}}','2010-01-25','http://www.grouvee.com/games/19545-heavy-rain/','21304');
