Insert into GAMETRACKER.GROUVEE_IMPORT (ID,NAME,SHELVES,PLATFORMS,RATING,REVIEW,DATES,STATUSES,GENRES,FRANCHISES,DEVELOPERS,PUBLISHERS,RELEASE_DATE,URL,GIANTBOMB_ID) values ('104','Machinarium','{"Steam": {"url": "http://www.grouvee.com/user/Guran/shelves/35271-steam/", "date_added": "2015-04-13T09:30:30Z"}, "Played": {"url": "http://www.grouvee.com/user/Guran/shelves/35267-played/", "date_added": "2015-04-13T09:30:30Z"}}','{"PC": {"url": "http://www.grouvee.com/games/?platform=pc"}, "Mac": {"url": "http://www.grouvee.com/games/?platform=mac"}, "Linux": {"url": "http://www.grouvee.com/games/?platform=linux"}}','4','<p>Machinarium is a cute game with cool art design and nice music. Its got a couple of innovative ideas, for example you can change the size of the main character and solve puzzles that way. Also there is no spoken dialogue, which is a positive thing and adds to the cartoony style. Other than that though, its a very traditional adventure game with some Myst-like puzzles thrown into the mix. Personally I found the puzzles too hard in the later sections and I often banged my head against the wall before I gave in and looked at hints.</p>','[{"date_finished": "None", "date_started": "None", "level_of_completion": null, "seconds_played": 32040}]','[]','{"Puzzle": {"url": "http://www.grouvee.com/games/?genre=puzzle"}, "Adventure": {"url": "http://www.grouvee.com/games/?genre=adventure"}}','{}','{"Amanita Design": {"url": "http://www.grouvee.com/games/?developer=amanita-design"}}','{"Lace Mamba Global": {"url": "http://www.grouvee.com/games/?publisher=lace-mamba-global"}, "Daedalic Entertainment": {"url": "http://www.grouvee.com/games/?publisher=daedalic-entertainment"}, "Amanita Design": {"url": "http://www.grouvee.com/games/?publisher=amanita-design"}}','2009-10-16','http://www.grouvee.com/games/104-machinarium/','23648');
Insert into GAMETRACKER.GROUVEE_IMPORT (ID,NAME,SHELVES,PLATFORMS,RATING,REVIEW,DATES,STATUSES,GENRES,FRANCHISES,DEVELOPERS,PUBLISHERS,RELEASE_DATE,URL,GIANTBOMB_ID) values ('19458','Blade Runner','{"Played": {"url": "http://www.grouvee.com/user/Guran/shelves/35267-played/", "date_added": "2015-04-13T22:13:29Z"}}','{"PC": {"url": "http://www.grouvee.com/games/?platform=pc"}}','5','<p>This was a game that I had in my shelf for a looong time but I only got around to play it recently. And what a pleasant surprise! This game is beautiful and catches the Blade Runner setting perfectly. The story is similar to the movie but still manage pull a few surprises on its own. Its definitely just not a movie ripoff. Puzzle elements were nice and I was excited during the whole playthrough. Multiple endings add to the replay value.</p>','[]','[]','{"Adventure": {"url": "http://www.grouvee.com/games/?genre=adventure"}}','{}','{"Westwood Studios, Inc.": {"url": "http://www.grouvee.com/games/?developer=westwood-studios-inc"}}','{"Virgin Interactive Entertainment, Inc.": {"url": "http://www.grouvee.com/games/?publisher=virgin-interactive-entertainment-inc"}}','1997-11-21','http://www.grouvee.com/games/19458-blade-runner/','21200');
Insert into GAMETRACKER.GROUVEE_IMPORT (ID,NAME,SHELVES,PLATFORMS,RATING,REVIEW,DATES,STATUSES,GENRES,FRANCHISES,DEVELOPERS,PUBLISHERS,RELEASE_DATE,URL,GIANTBOMB_ID) values ('139','Borderlands','{"Played": {"url": "http://www.grouvee.com/user/Guran/shelves/35267-played/", "date_added": "2015-04-13T09:14:40Z"}}','{"PC": {"url": "http://www.grouvee.com/games/?platform=pc"}}','2','<p>A shooter in a Mad Max world with RPG elements like quests and itemization thrown into the mix. An ok game, but nothing that I wanted to play for a very long time. The story is weak. I found myself skipping quest text and I''m a guy that usually reads them, even in World of Warcraft. The best thing with Borderlands is that its easy to set up a co-op game and go shooting with a friend. A very annoying thing though is that its not possible to abandon quests! After joining a few random groups my log was cluttered with quests that I couldnt finish in my level range anyway. And that made it hard to find the quests I actually wanted to do. To summarize: playing Borderlands single-player is boring, but the co-op can be fun!</p>','[{"date_finished": "None", "date_started": "None", "level_of_completion": null, "seconds_played": 12960}]','[]','{"Action": {"url": "http://www.grouvee.com/games/?genre=action"}, "First-Person Shooter": {"url": "http://www.grouvee.com/games/?genre=first-person-shooter"}, "Role-Playing": {"url": "http://www.grouvee.com/games/?genre=role-playing"}}','{"Borderlands": {"url": "http://www.grouvee.com/games/franchise/1769-borderlands/"}}','{"Gearbox Software LLC": {"url": "http://www.grouvee.com/games/?developer=gearbox-software-llc"}}','{"2K Games": {"url": "http://www.grouvee.com/games/?publisher=2k-games"}}','2009-10-20','http://www.grouvee.com/games/139-borderlands/','20487');
