Insert into GAMETRACKER.GROUVEE_IMPORT (ID,NAME,SHELVES,PLATFORMS,RATING,REVIEW,DATES,STATUSES,GENRES,FRANCHISES,DEVELOPERS,PUBLISHERS,RELEASE_DATE,URL,GIANTBOMB_ID) values ('11497','Spycraft: The Great Game','{"Played": {"url": "http://www.grouvee.com/user/Guran/shelves/35267-played/", "date_added": "2015-04-13T20:21:16Z"}}','{"PC": {"url": "http://www.grouvee.com/games/?platform=pc"}}','5','<p>This is a game that I had in my shelf for more than 10 years until I decided to start playing it. Graphics are outdated of course but many of the game elements are still very gripping today. The best thing about Spycraft is that it feels authentic in many parts, I felt like a CIA agent out on the field! The most outdated part are the shooting sequences but thankfully they are only a small portion of the game.</p>','[{"date_finished": "None", "date_started": "None", "level_of_completion": null, "seconds_played": 32400}]','[]','{"Adventure": {"url": "http://www.grouvee.com/games/?genre=adventure"}, "Simulation": {"url": "http://www.grouvee.com/games/?genre=simulation"}}','{}','{"Activision": {"url": "http://www.grouvee.com/games/?developer=activision"}}','{"Activision": {"url": "http://www.grouvee.com/games/?publisher=activision"}}','1996-02-29','http://www.grouvee.com/games/11497-spycraft-the-great-game/','12393');
Insert into GAMETRACKER.GROUVEE_IMPORT (ID,NAME,SHELVES,PLATFORMS,RATING,REVIEW,DATES,STATUSES,GENRES,FRANCHISES,DEVELOPERS,PUBLISHERS,RELEASE_DATE,URL,GIANTBOMB_ID) values ('4096','Roberta Williams'' Phantasmagoria','{"Played": {"url": "http://www.grouvee.com/user/Guran/shelves/35267-played/", "date_added": "2015-04-13T20:54:30Z"}}','{}','4','<p>When Phantasmagoria was released I bought the game but it bugged out when I tried to play it. It always annoyed me that I couldn''t play it but now I finally was able to after buying it on GOG.com.<br/>Roberta Williams wrote Phantasmagoria. The main character explores a house with many secrets and fans who have played her older games Mystery House and Colonel''s Bequest will feel right at home! But with one noticeable difference, this time the place is haunted! Phantasmagoria succeeds on many levels: the story is very intriguing and the atmosphere is great. The game is also manage to start out as slightly creepy and only gets more frightening as the chapters pass by. Gameplay is easy but that was fine with me. In this case it works since I didn''t want any overly complicated puzzles to ruin the immersion. Graphics were gorgeous back then but it feels outdated now. There was a lot of work on details around the house and this adds to the positive experience.<br/>In short, if you''re into adventure games and horror you don''t want to miss this great game.</p>','[{"date_finished": "None", "date_started": "None", "level_of_completion": null, "seconds_played": 36000}]','[]','{"Adventure": {"url": "http://www.grouvee.com/games/?genre=adventure"}}','{"Phantasmagoria": {"url": "http://www.grouvee.com/games/franchise/2813-phantasmagoria/"}}','{"Sierra Entertainment, Inc.": {"url": "http://www.grouvee.com/games/?developer=sierra-entertainment-inc"}, "Outrigger Koubou": {"url": "http://www.grouvee.com/games/?developer=outrigger-koubou"}}','{"Sierra Entertainment, Inc.": {"url": "http://www.grouvee.com/games/?publisher=sierra-entertainment-inc"}, "Outrigger Koubou": {"url": "http://www.grouvee.com/games/?publisher=outrigger-koubou"}}','1995-07-31','http://www.grouvee.com/games/4096-roberta-williams-phantasmagoria/','4327');
Insert into GAMETRACKER.GROUVEE_IMPORT (ID,NAME,SHELVES,PLATFORMS,RATING,REVIEW,DATES,STATUSES,GENRES,FRANCHISES,DEVELOPERS,PUBLISHERS,RELEASE_DATE,URL,GIANTBOMB_ID) values ('29867','Back to the Future: The Game - Episode 1: It''s About Time','{"Played": {"url": "http://www.grouvee.com/user/Guran/shelves/35267-played/", "date_added": "2015-04-13T22:22:53Z"}}','{"PC": {"url": "http://www.grouvee.com/games/?platform=pc"}}','4','<p>The first episode in Telltales "Back To The Future" series sets up the story nicely and leaves you wanting more, while still containing a story on its own. The strongest part of the game is the production quality, this IS Back to the Future! Marty and Doc are still in character and graphics, music and voicework are outstanding. The weak part of this game series as a whole would be that there is not much challenge to be found here, but for a game with such nice production values it does not matter much for a real BttF fan like me.</p>','[]','[]','{"Adventure": {"url": "http://www.grouvee.com/games/?genre=adventure"}}','{"Back to the Future": {"url": "http://www.grouvee.com/games/franchise/1249-back-to-the-future/"}}','{"Telltale Games": {"url": "http://www.grouvee.com/games/?developer=telltale-games"}}','{"Telltale Games": {"url": "http://www.grouvee.com/games/?publisher=telltale-games"}}','2010-12-22','http://www.grouvee.com/games/29867-back-to-the-future-the-game-episode-1-its-about-time/','32592');
