Insert into GAMETRACKER.GROUVEE_IMPORT (ID,NAME,SHELVES,PLATFORMS,RATING,REVIEW,DATES,STATUSES,GENRES,FRANCHISES,DEVELOPERS,PUBLISHERS,RELEASE_DATE,URL,GIANTBOMB_ID) values ('103','Gemini Rue','{"Steam": {"url": "http://www.grouvee.com/user/Guran/shelves/35271-steam/", "date_added": "2015-04-13T09:30:28Z"}, "Played": {"url": "http://www.grouvee.com/user/Guran/shelves/35267-played/", "date_added": "2015-04-13T09:30:28Z"}}','{"PC": {"url": "http://www.grouvee.com/games/?platform=pc"}}','4','<p>A solid adventure game in retro style. Gemini Rue runs only in 320x200 resolution, so people who play games for good graphics should stay away. But people who enjoy a cool story in the style of Blade Runner should definitely give this one a look! Puzzles are not too hard, although I did look in a walkthrough at one point. For me that is a good thing, as I find it frustrating to solve overcomplicated puzzles that detracts from the story.<br/>Gemini Rue was developed almost singe-handedly by Joshua Nuernberger, who studied at UCLA at the time. I find this to be quite incredible since it is easily comparable with many adventure games from the "good old days". Recommended!</p>','[{"date_finished": "None", "date_started": "None", "level_of_completion": null, "seconds_played": 4320}, {"date_finished": "None", "date_started": "None", "level_of_completion": "Main Story + Extras", "seconds_played": 28800}]','[]','{"Adventure": {"url": "http://www.grouvee.com/games/?genre=adventure"}}','{}','{}','{"EuroVideo Medien GmbH": {"url": "http://www.grouvee.com/games/?publisher=eurovideo-medien-gmbh"}, "Wadjet Eye Games": {"url": "http://www.grouvee.com/games/?publisher=wadjet-eye-games"}}','2011-02-24','http://www.grouvee.com/games/103-gemini-rue/','33797');
