Insert into GAMETRACKER.GROUVEE_IMPORT (ID,NAME,SHELVES,PLATFORMS,RATING,REVIEW,DATES,STATUSES,GENRES,FRANCHISES,DEVELOPERS,PUBLISHERS,RELEASE_DATE,URL,GIANTBOMB_ID) values ('2914','The Secret of Monkey Island','{"Steam": {"url": "http://www.grouvee.com/user/Guran/shelves/35271-steam/", "date_added": "2015-04-13T09:30:36Z"}, "Played": {"url": "http://www.grouvee.com/user/Guran/shelves/35267-played/", "date_added": "2015-04-13T09:30:36Z"}}','{"PC": {"url": "http://www.grouvee.com/games/?platform=pc"}}','5','<p>*This review is for the special edition found in digital stores*</p><p>I played through this game one more time and got surprised how good it still is today, 20 years later. Now we get an enhanced edition with the awesome feature that let you "hotswap" between the classic and the new version. It''s very cool! However, I feel that there are some minor flaws in the enhanced edition that keeps it from getting the full grade:<br/><br/>-Not possible to skip single dialogs. Enhanced edition only lets you skip whole cutscenes, very annoying! I actually sometimes switch to classic mode which has the ability to let you skip single dialogs.<br/>-No speech in classic mode. The voicework is great! Which makes it a shame that the speech is not enabled in the classic version. Everytime I hotswap I wish that they could just let speech stay on.<br/>-Animation is quite ugly in new version, it actually looks better in the old one!</p><p>The classic version is a true 5 star game.<br/></p>','[{"date_finished": "None", "date_started": "None", "level_of_completion": null, "seconds_played": 19080}]','[]','{"Adventure": {"url": "http://www.grouvee.com/games/?genre=adventure"}}','{"Monkey Island": {"url": "http://www.grouvee.com/games/franchise/779-monkey-island/"}}','{"A.C.R.O.N.Y.M. Games": {"url": "http://www.grouvee.com/games/?developer=acronym-games"}, "LucasArts Entertainment Company LLC": {"url": "http://www.grouvee.com/games/?developer=lucasarts-entertainment-company-llc"}}','{"U.S. Gold Ltd.": {"url": "http://www.grouvee.com/games/?publisher=us-gold-ltd"}, "Kixx": {"url": "http://www.grouvee.com/games/?publisher=kixx"}, "LucasArts Entertainment Company LLC": {"url": "http://www.grouvee.com/games/?publisher=lucasarts-entertainment-company-llc"}}','1990-10-15','http://www.grouvee.com/games/2914-the-secret-of-monkey-island/','3019');
