Insert into GAMETRACKER.GROUVEE_IMPORT (ID,NAME,SHELVES,PLATFORMS,RATING,REVIEW,DATES,STATUSES,GENRES,FRANCHISES,DEVELOPERS,PUBLISHERS,RELEASE_DATE,URL,GIANTBOMB_ID) values ('18202','World of Warcraft','{"Played": {"url": "http://www.grouvee.com/user/Guran/shelves/35267-played/", "date_added": "2015-04-13T09:17:22Z"}}','{"PC": {"url": "http://www.grouvee.com/games/?platform=pc"}}','5','<p>I played Wow for about 6 years and that must say something about the quality of this game. The world is really inviting and just plain fun to explore when you''re new. For every patch and expansion pack there are some things that get better and some things that get worse. At the time of writing, the current expansion is Cataclysm. In the story department this expansion beats the others with the fantastic starting campaigns for worgen and goblins. The new quests between lvl 80-85 are also very good, especially in Uldum. Single player has become too easy now though, I almost never die or have to be careful and thats a shame. But raiding is much harder than in Wrath, albeit not as hard or inaccessible as in Vanilla wow. Bottom line is, I really like the humour and style of Wow.</p>','[]','[]','{"MMORPG": {"url": "http://www.grouvee.com/games/?genre=mmorpg"}}','{"Warcraft": {"url": "http://www.grouvee.com/games/franchise/1416-warcraft/"}}','{"Blizzard Entertainment": {"url": "http://www.grouvee.com/games/?developer=blizzard-entertainment"}}','{"Blizzard Entertainment": {"url": "http://www.grouvee.com/games/?publisher=blizzard-entertainment"}}','2004-11-23','http://www.grouvee.com/games/18202-world-of-warcraft/','19783');
