Insert into GAMETRACKER.GROUVEE_IMPORT (ID,NAME,SHELVES,PLATFORMS,RATING,REVIEW,DATES,STATUSES,GENRES,FRANCHISES,DEVELOPERS,PUBLISHERS,RELEASE_DATE,URL,GIANTBOMB_ID) values ('8966','Age of Conan: Hyborian Adventures','{"Played": {"url": "http://www.grouvee.com/user/Guran/shelves/35267-played/", "date_added": "2015-06-17T07:19:47Z"}}','{"PC": {"url": "http://www.grouvee.com/games/?platform=pc"}}','3','<p>This review only covers the Tortage leveling from 1-20 as I only did that part.<br/><br/>I never got around to endure the notorious bad launch of Age of Conan, since my computer didnt measure up. Since its now free to play, I decided to give the starting region a go. And I was pleasantly surprised. I didnt experience any bugs whatsoever, graphics are beautiful and the storyline is engaging. I''ve never liked the Conan universe before but here its not as over the top as the movies. I''d say this seems like a decent MMOs, better and more original than later ones such as Rift and Forsaken World.</p>','[{"date_finished": "None", "date_started": "None", "level_of_completion": null, "seconds_played": 50400}]','[]','{"Action": {"url": "http://www.grouvee.com/games/?genre=action"}, "MMORPG": {"url": "http://www.grouvee.com/games/?genre=mmorpg"}}','{"Conan": {"url": "http://www.grouvee.com/games/franchise/253-conan/"}}','{"Funcom Productions A/S": {"url": "http://www.grouvee.com/games/?developer=funcom-productions-as"}}','{"Eidos Interactive": {"url": "http://www.grouvee.com/games/?publisher=eidos-interactive"}}','2008-05-20','http://www.grouvee.com/games/8966-age-of-conan-hyborian-adventures/','9641');
