Insert into GAMETRACKER.GROUVEE_IMPORT (ID,NAME,SHELVES,PLATFORMS,RATING,REVIEW,DATES,STATUSES,GENRES,FRANCHISES,DEVELOPERS,PUBLISHERS,RELEASE_DATE,URL,GIANTBOMB_ID) values ('30591','Back to the Future: The Game - Episode 2: Get Tannen!','{"Played": {"url": "http://www.grouvee.com/user/Guran/shelves/35267-played/", "date_added": "2015-04-13T22:22:56Z"}}','{"PC": {"url": "http://www.grouvee.com/games/?platform=pc"}}','4','<p>Excellent episode in Telltale''s faithful version of Back To The Future. Here Marty and Doc needs to stop Kid Tannen from totally destroying Marty''s future. The puzzles are fairly easy but since the story is good and a fun ride, it doesn''t matter much. A couple of the solutions also feel original. For instance, at one point Marty have to change a person''s mood to get the information he wants by changing the songs that he listens to.<br/>Overall a very enjoyable couple of hours and ends in a nice cliffhanger for episode 3.</p>','[]','[]','{"Adventure": {"url": "http://www.grouvee.com/games/?genre=adventure"}}','{"Back to the Future": {"url": "http://www.grouvee.com/games/franchise/1249-back-to-the-future/"}}','{"Telltale Games": {"url": "http://www.grouvee.com/games/?developer=telltale-games"}}','{"Telltale Games": {"url": "http://www.grouvee.com/games/?publisher=telltale-games"}}','2011-02-16','http://www.grouvee.com/games/30591-back-to-the-future-the-game-episode-2-get-tannen/','33414');
