Insert into GAMETRACKER.GROUVEE_IMPORT (ID,NAME,SHELVES,PLATFORMS,RATING,REVIEW,DATES,STATUSES,GENRES,FRANCHISES,DEVELOPERS,PUBLISHERS,RELEASE_DATE,URL,GIANTBOMB_ID) values ('38','Star Wars: The Old Republic','{"Played": {"url": "http://www.grouvee.com/user/Guran/shelves/35267-played/", "date_added": "2015-04-13T12:09:45Z"}}','{"PC": {"url": "http://www.grouvee.com/games/?platform=pc"}}','4','<p>A very good MMO, the class stories are definitely exciting and makes leveling a fun experience. I also had alot of fun with PvP. Regarding instances: the first instance for each faction is very good (Black Talon/Esseles), the others are ok but nothing extraordinary. Sound and graphics are excellent, it really feels like a Star Wars universe. A couple of small things annoyed me though. Firstly, since the world is so huge it can sometimes be tedious to move around. Second, some the side quests can be boring and feels like filler. Id rather just play the class stories if I could. Overall though, this is a fantastic game! I quit playing The Old Republic only because it took too much of my time and I couldn''t put the the game down!</p><p>Disclaimer I never got to the endgame with operations so these opinions are only based on the levelling process and multiplayer. I mainly played a Sith Warrior, Bounty Hunter and Imperial Agent.</p>','[{"date_finished": "None", "date_started": "None", "level_of_completion": null, "seconds_played": 525600}]','[]','{"MMORPG": {"url": "http://www.grouvee.com/games/?genre=mmorpg"}}','{"Star Wars": {"url": "http://www.grouvee.com/games/franchise/88-star-wars/"}}','{"BioWare": {"url": "http://www.grouvee.com/games/?developer=bioware"}}','{"EA Games": {"url": "http://www.grouvee.com/games/?publisher=ea-games"}}','2011-12-20','http://www.grouvee.com/games/38-star-wars-the-old-republic/','24205');
