Insert into GAMETRACKER.GROUVEE_IMPORT (ID,NAME,SHELVES,PLATFORMS,RATING,REVIEW,DATES,STATUSES,GENRES,FRANCHISES,DEVELOPERS,PUBLISHERS,RELEASE_DATE,URL,GIANTBOMB_ID) values ('122','Assassin''s Creed II','{"Steam": {"url": "http://www.grouvee.com/user/Guran/shelves/35271-steam/", "date_added": "2016-01-03T10:14:54Z"}, "Played": {"url": "http://www.grouvee.com/user/Guran/shelves/35267-played/", "date_added": "2015-04-13T09:17:47Z"}}','{"PC": {"url": "http://www.grouvee.com/games/?platform=pc"}, "Mac": {"url": "http://www.grouvee.com/games/?platform=mac"}}','5','<p>This was a game that I played in less a week even though my game time came up to 36 hours. I just couldnt stop playing all the captivating missions! Gameplay has improved alot on the original. I find that the best new addition are the Assassin''s Tombs. They are just great fun to explore and those who loved the Prince of Persia games will feel right at home. Solving puzzles from Subject 16 is also very fun and a good addition. My PC version included the two DLC''s that were originally sold as separate expansions but here they are included into the game. I didnt like this, since the drop in production quality really shows. Other than that, everything is great!</p>','[{"date_finished": "None", "date_started": "None", "level_of_completion": null, "seconds_played": 128880}]','[]','{"Action-Adventure": {"url": "http://www.grouvee.com/games/?genre=action-adventure"}, "Platformer": {"url": "http://www.grouvee.com/games/?genre=platformer"}}','{"Assassin''s Creed": {"url": "http://www.grouvee.com/games/franchise/769-assassins-creed/"}}','{"Ubisoft Montreal Studios": {"url": "http://www.grouvee.com/games/?developer=ubisoft-montreal-studios"}}','{"Ubisoft Entertainment": {"url": "http://www.grouvee.com/games/?publisher=ubisoft-entertainment"}}','2009-11-17','http://www.grouvee.com/games/122-assassins-creed-ii/','22928');
