Insert into GAMETRACKER.GROUVEE_IMPORT (ID,NAME,SHELVES,PLATFORMS,RATING,REVIEW,DATES,STATUSES,GENRES,FRANCHISES,DEVELOPERS,PUBLISHERS,RELEASE_DATE,URL,GIANTBOMB_ID) values ('94','Amnesia: The Dark Descent','{"Steam": {"url": "http://www.grouvee.com/user/Guran/shelves/35271-steam/", "date_added": "2015-04-13T09:30:24Z"}, "Played": {"url": "http://www.grouvee.com/user/Guran/shelves/35267-played/", "date_added": "2015-04-13T09:30:24Z"}}','{"PC": {"url": "http://www.grouvee.com/games/?platform=pc"}, "Mac": {"url": "http://www.grouvee.com/games/?platform=mac"}, "Linux": {"url": "http://www.grouvee.com/games/?platform=linux"}}','5','<p> I had high expectations for Amnesia: The Dark Descent and it didnt disappoint. It is very creepy, I had to play in slight chunks since the game really did scare me at certain points. The pacing is very good with a nice mix of story elements, escaping monsters, solving puzzles and having flashbacks. Recommended for anyone who wants a good scare and is able to play a game without any weapon in your hands!</p>','[{"date_finished": "None", "date_started": "None", "level_of_completion": null, "seconds_played": 56160}]','[]','{"Puzzle": {"url": "http://www.grouvee.com/games/?genre=puzzle"}, "Adventure": {"url": "http://www.grouvee.com/games/?genre=adventure"}}','{"Amnesia": {"url": "http://www.grouvee.com/games/franchise/2202-amnesia/"}}','{"Frictional Games": {"url": "http://www.grouvee.com/games/?developer=frictional-games"}}','{"Frictional Games": {"url": "http://www.grouvee.com/games/?publisher=frictional-games"}, "THQ": {"url": "http://www.grouvee.com/games/?publisher=thq"}}','2010-09-08','http://www.grouvee.com/games/94-amnesia-the-dark-descent/','30087');
Insert into GAMETRACKER.GROUVEE_IMPORT (ID,NAME,SHELVES,PLATFORMS,RATING,REVIEW,DATES,STATUSES,GENRES,FRANCHISES,DEVELOPERS,PUBLISHERS,RELEASE_DATE,URL,GIANTBOMB_ID) values ('211','Baldur''s Gate','{"Played": {"url": "http://www.grouvee.com/user/Guran/shelves/35267-played/", "date_added": "2015-04-13T17:18:25Z"}}','{"PC": {"url": "http://www.grouvee.com/games/?platform=pc"}}','4','<p>The beginning of the 90''s saw one of the best game releases ever, Origin''s Ultima VII games. I found them fantastic and waited for many years for a game that could match them. With Baldur''s Gate I finally found that game! While the story is weaker and too dark for my taste, the game is still lots of fun. The game interface is very intuitive and easy to use. It follows the Advanced Dungeons and Dragons rules but still manages to have exciting combat. Characters are diverse and have lots of dialogue. And depending on which partners you choose your gaming experience will become very different. This was a groundbreaking game for its time and it is still fun to play today.</p>','[]','[]','{"Role-Playing": {"url": "http://www.grouvee.com/games/?genre=role-playing"}}','{"Baldur''s Gate": {"url": "http://www.grouvee.com/games/franchise/84-baldurs-gate/"}, "Dungeons & Dragons": {"url": "http://www.grouvee.com/games/franchise/85-dungeons-dragons/"}}','{"Beamdog": {"url": "http://www.grouvee.com/games/?developer=beamdog"}, "BioWare": {"url": "http://www.grouvee.com/games/?developer=bioware"}}','{"Black Isle Studios": {"url": "http://www.grouvee.com/games/?publisher=black-isle-studios"}, "Interplay Entertainment Corp.": {"url": "http://www.grouvee.com/games/?publisher=interplay-entertainment-corp"}}','1998-11-30','http://www.grouvee.com/games/211-baldurs-gate/','52');
